    "Prognostics for Ground Support Systems: Case Study on Pneumatic Valves",nt"tracking_summary":
    {ntt"total": 8,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-26T22:02:57.342478",nt"name": "prognostics-for-ground-support-systems-case-study-on-pneumatic-valves",nt"isopen":
    true,nt"url": null,nt"notes": "Prognostics technologies determine the health
    (or damage) state of a component or sub- system, and make end of life (EOL) and
    remaining useful life (RUL) predictions. Such infor- mation enables system operators
    to make informed maintenance decisions and streamline operational and mission-level
    activities. We develop a model-based prognostics method- ology for pneumatic valves
    used in ground support equipment for cryogenic propellant loading operations. These
    valves are used to control the ow of propellant, so failures may have a signi cant
    impact on launch availability. Therefore, correctly predicting when valves will
    fail enables timely maintenance that avoids launch delays and aborts. The approach
    utilizes mathematical models describing the underlying physics of valve degradation,
    and, employing the particle ltering algorithm for joint state-parameter estimation,
    determines the health state of the valve and the rate of damage progression, from
    which EOL and RUL predictions are made. We develop a prototype user interface for
    valve prognostics, and demonstrate the prognostics approach using historical pneumatic
    valve data from the Space Shuttle refueling system.",nt"license_title": "U.S.
